import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <header>
        <nav>
          <ul>
            <li>First</li>
            <li>Second</li>
            <li>Third</li>
            <li>Fourth</li>
          </ul>
        </nav>
        <button>Login | Sign Up</button>
      </header>
      <section>
        <h1>Welcome to My Hotel</h1>
        <p>Explanations about your hotel go here.</p>
      </section>
    </div>
  );
}

export default App;
